  `id_card` varchar(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '身份证',
  `level` int(11) NULL DEFAULT NULL COMMENT '会员等级 0普通用户 1乐享居民  2乐享创业人  3乐享城主  4乐享合伙人',
  `identity` int(11) NULL DEFAULT NULL COMMENT '员工身份',
