  `balance` int(11) NULL DEFAULT NULL COMMENT '余额',
  `integral` int(11) NULL DEFAULT NULL COMMENT '积分',
  `total_income` int(11) NULL DEFAULT NULL COMMENT '总收益',
  `now_income` int(11) NULL DEFAULT NULL COMMENT '现在可用收益',
  `freeze_income` int(11) NULL DEFAULT NULL COMMENT '现在可用收益',
