  `second_level_proxy_ratio` float NULL DEFAULT NULL COMMENT '二级代理收成比例',
  `invite_amount` int(11) NULL DEFAULT NULL COMMENT '邀请数',
  `purchaseDiscount` int(11) NULL DEFAULT NULL COMMENT '购房折扣',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 100035 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Dynamic;

