INSERT INTO `app_card` VALUES (1, '乐享休闲卡', 'http://yanxuan.nosdn.127.net/0b93f12f992094baf097ccb88780e241.jpg', 688800, NULL, '本卡采取实名制。持卡人可享受平台一次赠送6888积分，积分可在“乐享部落”积分商城兑换等值商品。;购买本卡可自动获得“乐享部落”会员身份，享受平台消费及线下现金消费100赠送70积分的权益。;持卡人享受在“乐享部落”指定酒店内会员价格，并在会员价格的基础上，再次享受8.8折优惠的权利。;本卡最终解释权归公司所有。', 688800, 1);
INSERT INTO `app_card` VALUES (2, '乐享生活卡', 'http://yanxuan.nosdn.127.net/36c04adfbf3e3a11eda2362cf7c6f6ef.jpg', 1000000, NULL, '本卡采用实名制。并且一次性只能预定房间二间。;持卡人享受“乐享部落”赠送的指定酒店房券100张，三年内使用完。;本卡内一次性赠送2000积分，积分可在“乐享部落”积分商城兑换等值商品。;购买本卡将自动获得“乐享部落”会员身份，享受平台消费及线下现金消费满100送70积分的权益。;订房须提前预定（非节假日10个工作日，节假日15个工作日），每次预定入住时间不得少于10天，不足10天按照10天结算；预定成功不能退订。;本卡消费内容只限双标间，其他消费需要另外收费。;本卡可更名、转让、转赠及继承。;本卡最终解释权归公司所有。', 200000, 0);
INSERT INTO `app_card` VALUES (3, '乐享无忧卡', 'http://yanxuan.nosdn.127.net/9897174cd752a475973fa04df2ab97eb.jpg', 3000000, NULL, '本卡采取实名制。持卡人凭此卡可入住“乐享部落”指定酒店2年（含365间标间房），本卡有效期为3年，过期自行作废。;本卡消费内容仅限标间入住，其他消费另行收费。;订房须提前预定（非节假日10个工作日，节假日15个工作日），每次预定入住时间不得少于10天，不足10天按照10天结算；预定成功不能退订。;持卡人每消费一间房，赠送85消费积分，此卡全部消费完毕可累计赠送31000积分，积分可在“乐享部落”积分商城兑换等值商品。;购本卡将自动获得“乐享部落”会员身份。享受平台消费及线下现金消费100元赠送70积分的权益。;本卡可更名、转让、转赠及继承，遗失不补。;本卡最终解释权归公司所有。', 0, 0);
